    t.put("footer_pages/contact_us.html", "<div class='container-fluid footer-layout' id='profile' ng-init='vm.init()'>\n<div class='row margin-0'>\n<div class='col-lg-12'>\n<div class='primary-title'>\nCONTACT US\n</div>\n<div class='secondary-title text-center padding-bottom-10'>\n<b>Support hours: 10 AM to 8 PM</b>\n</div>\n</div>\n</div>\n<div class='row margin-0'>\n<div class='col-lg-12 col-md-12'>\n<div class='contact-form'>\n<form>\n<div class='row'>\n<div class='form-group'>\n<input class='padding-left-10' name='name' ng-model='vm.ticket.name' placeholder='Name'>\n</div>\n</div>\n<div class='row'>\n<div class='form-group'>\n<input class='padding-left-10' name='name' ng-model='vm.ticket.email' placeholder='Email'>\n</div>\n</div>\n<div class='row'>\n<div class='form-group'>\n<div class='input-group'>\n<span class='input-group-addon'>+91</span>\n<input class='padding-left-10' name='name' ng-model='vm.ticket.phone' placeholder='Mobile Number'>\n</div>\n</div>\n</div>\n<div class='row'>\n<div class='form-group'>\n<textarea class='padding-left-10' name='name' ng-model='vm.ticket.description' placeholder='Description' rows='5'></textarea>\n</div>\n</div>\n<div class='row padding-bottom-20'>\n<div class='kyc-button'>\n<button class='padding-left-10' data-style='zoom-in' ladda='vm.contactLadda' ng-click='vm.submit()' style='width:30%;'>SUBMIT</button>\n</div>\n</div>\n<div class='row'>\nFor any business related queries, please drop a mail to team@koinex.in and we will get back to you promptly.\n</div>\n</form>\n</div>\n</div>\n</div>\n</div>")
